import styled from "styled-components"

const DirectoryMenuItem = styled.div`
margin-bottom:20px;
.background{
    display:flex;
    width:100%;
    height:450px;
    background-repeat:no-repeat;
    margin:0 auto;
    .content{
        align-self:center;
        margin:0 120px;
        width:400px;
        .title{
            letter-spacing: 3px;
        }
    }
}
`
export default DirectoryMenuItem
